const Login = () => {
  const navigate = useNavigate();

  const handleNavigate = () => {
    toast("Wow so easy!");
    navigate("/sign-up");
  };

  return (
    <div>
      <button onClick={this.notify}>Notify !</button>
      <ToastContainer />
    </div>
  );
};

export default Login;
